import React from 'react';
import NavBar from './components/NavBar'
import { Route } from 'react-router-dom';
import Login from './components/Login'

import './App.css';

class App extends React.Component {

  render() {
    return(
      <div className="app">
        <NavBar/>
        <Route exact path="/login" render={() => <Login />}/>
      </div>
    )
  }
}

export default App;
